Description:
IMM_BRESP : This field is only valid for Host slave WR mode.

0 : Wait for response from Host. ;

1 : Generate immediate BRESP to DUT ;

Mode_0_1: this bit selects the HW Bridge’s mode of operation.

0: mode_0 register access mode is selected. ;

1: mode_1 Indirect DMA mode is selected. ;

DATA_WIDTH : AXI-data width. 
0x0 : 8-bit ;

0x1 : 16-bit ;

0x2 : 32-bit ;

0x3 : 64-bit ;

0x4 : 128-bit ;

0x5 : 256-bit ;

0x6 : 512-bit ;

0x7 : 1024 ;

ERR_1 :Error at XDMA slave interface  (this error is only valid for mode-1).

0 : No error ;

1 : Error

OWNERSHIP: this bit indicates the current ownership of a particular transaction.

0: Ownership is with SW ;

1: Ownership is with HW ;

AVAIL: this bit indicates transaction request from DUT is available with Bridge.

0: Transation from DUT is not available ;

1: Transation from DUT is available

EN_AVAIL : 

1 = enables interrupt generation if  AVAIL bit in INTR_TXN_AVAIL_STATUS_REG is set ;
0 = disables interrupt generation

EN_COMP: 

1 = enables interrupt generation if  COMPLETION bit in INTR_COMP_STATUS_REG is set ;
0 = disables interrupt generation
